import React,{Component, Fragment} from 'react';
import Nav from "../pages/Nav";
class AboutPage extends Component{
    render(){
        return (
        <Fragment>
            <Nav />
            <h3>About Page</h3>
        </Fragment>
        )
    }
}
export default AboutPage;
